import numpy as np
i4 = np.int32
i8 = np.int64


def factorization(N):
    p = np.zeros(N + 1, i8)
    n_max = int(np.sqrt(N)) + 1
    p[0] = 1
    p[1] = 1
    for i in range(2, n_max):
        if p[i] == 0:
            j = i
            while j <= N:
                p[j] = i
                j += i
    for i in range(n_max, N + 1):
        if p[i] == 0:
            p[i] = i
    return p


def gcd(a, b):
    '''Computes the greatest common divisor of integers a and b using
    Euclid's Algorithm.
    '''
    while b != 0:
        a, b = b, a % b
    return a


def solve(A):
    a = np.sort(A)
    g = a[0]
    for i in range(1, a.shape[0]):
        g = gcd(a[i], g)
    if g > 1:
        return 2
    p_max = a[-1]
    p = factorization(p_max)
    primes_num = 0
    for i in range(2, p.shape[0]):
        if i == p[i]:
            primes_num += 1
    a_start = 0
    while a[a_start] == 1:
        a_start += 1
        if a_start == a.shape[0]:
            return 0
    a = a[a_start:]
    if len(a) > primes_num:
        return 1
    check = np.zeros(p_max + 1, i8)
    s = set()
    for d in a:
        while d > 1:
            x = p[d]
            s.add(x)
            d //= x

        while s:
            check[s.pop()] += 1

    if check.max() > 1:
        return 1
    else:
        return 0


def main(in_file):
    stdin = open(in_file)
    stdin.readline()
    A = np.array([int(x) for x in stdin.readline().split()])
    ans = solve(A)
    p = ['pairwise coprime', 'setwise coprime', 'not coprime']
    print(p[ans])


